import React, { Component } from "react";
import { connect } from "react-redux";
import { TextInput, Icon, Button } from "react-materialize";

class ContactForm extends Component {
    render() {
        return (
            <div>
                <form>
                    <Row>


                    <TextInput
                        s={12}
                        l={2}
                        m={2}
                        xl={2}
                        label='Name'
                        name='name'
                        required
                    />
                    <TextInput
                        s={12}
                        l={3}
                        m={3}
                        xl={3}
                        label='Phone'
                        name='phone'
                        required
                    />
                    <TextInput
                        s={12}
                        l={6}
                        m={4}
                        xl={4}
                        label='Email'
                        email
                        validate
                        name='email'
                    />
                    <Button
                        node='a'
                        type='submit'
                        small
                        style={{
                            marginTop: "25px"
                        }}
                        waves='light'
                    >
                        {" "}
                        Save
                        <Icon left>save</Icon>
                    </Button>
                    </Row>
                </form>
            </div>
        );
    }
}

const mapStateToProps = state => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(ContactForm);
